import java.util.Arrays;

public class findTheDifference {
    public static void main(String[] args) {
        String s = "";
        String t = "";
        String newS = s + "~";
        char[] arrS = newS.toCharArray();
        char[] arrT = t.toCharArray();

        Arrays.sort(arrS);
        Arrays.sort(arrT);

        char res = '0';
        for (int i = 0; i < newS.length(); i++) {
            if (arrS[i] != arrT[i]) {
                res = arrT[i];
                break;
            }
        }
        System.out.println(res);
    }
}